text:
محمود احمدی‌نژاد 
@Ahmadinejad1956
، سی‌ویکم تیر ۱۴۰۰: "چه کسی غیر از باند فاسد امنیتی امکان این کار را دارد که اراذل و اوباش را سازماندهی و مسلح کند؟ آیا این کار جز برای برخورد با مردم است؟"

محمود احمدی‌نژاد 
@Ahmadinejad1956
، چهارم آذر ۱۴۰۰: "شما شنیده‌اید که بگویند برای عوامل تیراندازی به مردم پرونده تشکیل شده و تحت تعقیب قرار گرفته‌اند؟ ما که نشنیدیم! اگر سری باشد، دیگر من خبر ندارم! مردم را علنی در خیابان کشتند."

